from Bio.Seq import Seq
import math

dH = {"AA": -7900, "TT": -7900, "AT": -7200, "TA": -7200, "TG": -8500, "CA": -8500, "GT": -8400, "AC": -8400,
    "CT": -7800, "AG": -7800, "GA": -8200, "TC": -8200,"CG": -10600, "GC": -9800, "GG": -8000, "CC": -8000}

dS = {"AA": -21.3, "TT": -21.3, "AT": -20.4, "TA": -21.3, "TG": -22.7, "CA": -22.7, "GT": -22.4, "AC": -22.4,
    "CT": -21.0, "AG": -21.0, "GA": -22.2, "TC": -22.2, "CG": -27.2, "GC": -24.4, "GG": -19.9, "CC": -19.9}

def calculate_tm(seq, Na=50e-3):
    seq = seq.upper()
    total_dH = 0
    total_dS = 0

    for i in range(len(seq) - 1):
        pair = seq[i:i+2]
        if pair in dH:
            total_dH += dH[pair]
            total_dS += dS[pair]
        else:
            raise ValueError(f"Invalid pair {pair} in sequence.")

    total_dH += 0  
    total_dS += -10.8 

    R = 1.987  # Gas constant 
    Tm_kelvin = (1000 * total_dH) / (total_dS + (R * (math.log(250e-9))))  
    Tm_celsius = Tm_kelvin - 273.15
    return Tm_celsius

def find_three_prime_end_base_pairs(mutated_sequence, mutation_position=3140):
    three_prime_end = mutated_sequence[mutation_position:]

    complement = {'A': 'T', 'T': 'A', 'C': 'G', 'G': 'C'}
    three_prime_complement = ''.join([complement[base] for base in three_prime_end])

    return three_prime_complement


def calculate_tm(sequence, concentration=50e-9):
    delta_H = 0
    delta_S = 0
    R = 1.987 
    for i in range(len(sequence) - 1):
        pair = sequence[i:i+2]
        if pair in dH:
            delta_H += dH[pair]
            delta_S += dS[pair]
    tm = (delta_H * 1000) / (delta_S + R * math.log(concentration)) - 273.15
    
    return tm

def adjust_sequence_tm(sequence, target_tm=60.0, max_iterations=10000):
    tm = calculate_tm(sequence)
    print(f"Initial Tm: {tm:.2f}°C")
    
    iterations = 0
    last_tm_difference = abs(tm - target_tm)
    
    while abs(tm - target_tm) > 1.0 and iterations < max_iterations:
        if tm < target_tm:
            sequence += "GC"  
        else:
            sequence = sequence[:-2] 
        
        tm = calculate_tm(sequence)
        print(iterations)
        print(f"Adjusted Tm: {tm:.2f}°C")
        
        iterations += 1
        last_tm_difference = abs(tm - target_tm)
        
    if abs(tm - target_tm) >= last_tm_difference:
        print("Tm adjustment stuck, stopping adjustments.")
    
    return sequence

def main():
    pik3ca_cdna = ""
    sequence_list = list(pik3ca_cdna)
    sequence_list[3140 - 1] = 'G'
    pik3ca_mutant = ''.join(sequence_list)
    three_prime_complement = find_three_prime_end_base_pairs(pik3ca_mutant)
    adjust_sequence_tm(three_prime_complement)


if __name__ == "__main__":
    main()